import axios from "axios";

export default axios.create({
  baseURL: "http://localhost:1337",
  headers: {
    "Content-type": "application/json",
    "Access-Control-Allow-Origin": "http://localhost:1337",
    "Access-Control-Allow-Credentials": "true",
  },
});
